import React, { Component } from 'react';

function MoreValue() {
    const more = {
        textAlign: "center",
        padding: "0.4em",
        width: "30%",
        minWidth: "150px",
        margin: "0 auto",
        marginTop: "0.6em",
        border: "1px solid"
    }
    return (
        <a href={ this.props.link } onClick="">
            {
                !function () {
                    if (this.props.more != undefined) {
                        return (
                            <div style={ more }>
                                { this.props.more }
                            </div>
                        );
                    }
                }()
            }
        </a>
    );
}

class Section extends Component {
    render() {
        const center = {
            textAlign: "center"
        };
        return (
            <section style={ center }>
                <h2>{ this.props.title }</h2>
                { this.props.children }
                <MoreValue { ...this.props } />
            </section>
        );
    }
}
export default Section;
